INSERT INTO `styleGroup` VALUES (0000000001,'intern',NULL,NULL),(0000000002,'Form','A form is a wrapper for input fields. It allows to send content of the input fields to the server and store the data to the database. Several style are available:',60),(0000000003,'Input','An input field must be placed inside a form wrapper. An input field allows a user to enter data and submit these to the server. The chosen form wrapper decides what happens with the submitted data. The following input fields styles are available:',70),(0000000004,'Wrapper','A wrapper is a style that allows to group child elements. Wrappers can have a visual component or can be invisible. Visible wrapper are useful to provide some structure in a document while invisible wrappers serve merely as a grouping option . The latter can be useful in combination with CSS classes. The following wrappers are available:',10),(0000000005,'Text','Text styles allow to control how text is displayed. These styles are used to create the main content. The following styles are available:',20),(0000000006,'List','Lists are styles that allow to define more sophisticated lists than the markdown syntax allows. They come with attached javascript functionality. The following lists are available:',50),(0000000007,'Media','The media styles allow to display different media on a webpage. The following styles are available:',40),(0000000008,'Link','Link styles allow to render different types of links:',30),(0000000009,'Admin','The admin styles are for user registration and access handling.\r\nThe following styles are available:',80),(0000000010,'Graph','Graph styles allow to draw graps and diagrams based on static (uploaded assets) or dynamic (user input) data.',55),(0000000011,'Filter','Filter styles allow to filter data sets and store the filter state in the session. This allows to filter all styles using the same data source with only one filter',56);
/*!40000 ALTER TABLE `styleGroup` ENABLE KEYS */;
