INSERT INTO `styles` VALUES (0000000001,'login',0000000002,0000000009,'provides a small form where the user can enter his or her email and password to access the WebApp. It also includes a link to reset a password.'),(0000000002,'profile',0000000002,0000000001,''),(0000000003,'container',0000000001,0000000004,'is an **invisible** wrapper.'),(0000000004,'jumbotron',0000000001,0000000004,'is a **visible** wrapper that wraps its content in a grey box with large spacing.'),(0000000005,'heading',0000000001,0000000005,'is used to display the 6 levels of HTML headings.'),(0000000006,'markdown',0000000001,0000000005,'is the bread-and-butter style which allows to style content in a very flexible way. In addition to markdown syntax, pure HTML statements are allowed which makes this style very versatile. It is recommended to limit the usage of HTML to a minimum in order to keep the layout of the webpage consistent.'),(0000000007,'markdownInline',0000000001,0000000005,'is similar to the markdown style but is intended for one-line text where emphasis is required.'),(0000000008,'button',0000000001,0000000008,'renders a button-style link with several predefined colour schemes.'),(0000000009,'validate',0000000002,0000000001,''),(0000000010,'chat',0000000002,0000000001,''),(0000000011,'alert',0000000001,0000000004,'is a **visible** wrapper that draws a solid, coloured box around its content. The text colour of the content is changed according to the type of alert.'),(0000000012,'card',0000000001,0000000004,'is a versatile **visible** wrapper that draws a fine border around its content. A card can also have a title and can be made collapsible.'),(0000000013,'figure',0000000001,0000000007,'allows to attach a caption to media elements. A figure expects a media style as its immediate child.'),(0000000014,'form',0000000001,0000000002,'provides only the client-side functionality and does not do anything with the submitted data. This is intended to be connected with a custom component (required PHP programming).'),(0000000015,'image',0000000001,0000000007,'allows to render an image on a page.'),(0000000016,'input',0000000002,0000000003,'is a one-line input field style that allows to enter different types of data (e.g. text, color, time, date, checkbox).'),(0000000017,'plaintext',0000000001,0000000005,'renders simple text. No special syntax is allowed here.'),(0000000018,'link',0000000001,0000000008,'renders a standard link but allows to open the target in a new tab.'),(0000000019,'progressBar',0000000001,0000000007,'allows to render a static progress bar.'),(0000000020,'quiz',0000000001,0000000004,'is a predefined assembly of tabs, intended to ask a question and provide a right and wrong answer tab.'),(0000000021,'rawText',0000000001,0000000005,'renders text in a mono-space font which makes it useful to display code.'),(0000000022,'select',0000000002,0000000003,'is a input field style that provides a predefined set of choices which can be selected with a dropdown menu. In contrast to the radio style the select style has a different visual appearance and provides a list of options where also multiple options can be chosen.'),(0000000023,'slider',0000000002,0000000003,'is an extension of the style input of type range. It allows to provide a label for each position of the slider.'),(0000000024,'tab',0000000001,0000000004,'is a child element of the style `tabs`.'),(0000000025,'tabs',0000000001,0000000004,'is a **visible** wrapper that allows to group content into tabs and only show one tab at a time. It requires `tab` styles as its immediate children. Each `tab` then accepts children which represent the content of each tab.'),(0000000026,'textarea',0000000002,0000000003,'is a multi-line input field style that allows to enter multiple lines of text.'),(0000000027,'video',0000000001,0000000007,'allows to load and display a video on a page.'),(0000000028,'accordionList',0000000002,0000000006,'is a **hierarchical** list where the root level is rendered as an accordion with only one root item expanded at a time.'),(0000000030,'navigationContainer',0000000001,0000000004,'is an **invisible** wrapper and is used specifically for navigation pages.'),(0000000031,'navigationAccordion',0000000003,0000000001,''),(0000000032,'nestedList',0000000002,0000000006,'is a **hierarchical** list where each root item item can be collapsed and expanded by clicking on a chevron.'),(0000000033,'navigationNested',0000000003,0000000001,''),(0000000034,'sortableList',0000000001,0000000006,'is **non-hierarchical** but can be sorted, new items can be added as well as items can be deleted. Note that only the visual aspects of these functions are rendered. The implementation of the functions need to be defined separately with javascript (See <a href=\"https://github.com/RubaXa/Sortable\" target=\"_blank\">Sortable</a> for more details).'),(0000000035,'resetPassword',0000000002,0000000001,''),(0000000036,'formUserInput',0000000002,0000000002,'stores the data from all child input fields into the database and displays the latest set of data in the database as values in the child input field (if `is_log` is unchecked).'),(0000000038,'radio',0000000002,0000000003,'allows to predefine a set of options for the user to select. It provides a list of options where only one option can be chosen.'),(0000000039,'showUserInput',0000000002,0000000002,'allows to display user input data. Use the name of a form to display the corresponding data.'),(0000000040,'div',0000000001,0000000004,'allows to wrap its children in a simple HTML `<div>` tag. This allows to create more complex layouts with the help of bootstrap classes.'),(0000000041,'register',0000000002,0000000009,'provides a small form to allow a user to register for the WebApp. In order to register a user must provide a valid email and activation code. Activation codes can be generated in the admin section of the WebApp. The list of available codes can be exported.'),(0000000042,'conditionalContainer',0000000002,0000000004,'is an **invisible** wrapper which has a condition attached. The content of the wrapper is only displayed if the condition resolves to true.'),(0000000043,'audio',0000000001,0000000007,'allows to load and replay an audio source on a page.'),(0000000044,'carousel',0000000001,0000000007,'allows to render multiple images as a slide-show.'),(0000000045,'json',0000000002,0000000004,'allows to describe styles with `json` Syntax'),(0000000046,'userProgress',0000000002,0000000009,'A progress bar to indicate the overall experiment progress of a user.'),(0000000047,'mermaidForm',0000000002,0000000002,'Style to create diagrams using markdown syntax. Use <a href=\"https://mermaidjs.github.io/demos.html\" target=\"_blank\">mermaid markdown</a> syntax here.'),(0000000048,'emailForm',0000000002,0000000002,'A form to accept an email address and automatically send two emails: An email to the address entered in the form and another email to admins, specified in the style.'),(0000000049,'autocomplete',0000000001,0000000001,'Provides a text input field which executes an AJAX request on typing.\r\nA AJAX request class and method must be defined for this to work.'),(0000000050,'graph',0000000002,0000000010,'The most general graph style which allows to render a vast variety of graphs but requires extensive configuration. All other graph styles are based on this style.'),(0000000051,'graphSankey',0000000002,0000000010,'Create a Sankey diagram from user input data or imported static data.'),(0000000052,'filterToggle',0000000002,0000000011,'Create a toggle button which will enable or disable a filter on a set of data.'),(0000000053,'filterToggleGroup',0000000002,0000000011,'Create a group of toggle buttons which will enable or disable a filter on a set of data. Multiple active buttons are combinde with the logic or function.'),(0000000054,'graphPie',0000000002,0000000010,'Create a pie diagram from user input data or imported static data.'),(0000000055,'graphBar',0000000002,0000000010,'Create a bar diagram from user input data or imported static data.'),(0000000056,'graphLegend',0000000001,0000000010,'Render colored list of items. This can be used to show one global legend for multiple graphs.'),(0000000057,'navigationBar',0000000001,0000000001,'Provides a navigation bar style'),(0000000058,'qualtricsSurvey',0000000002,0000000002,'Visualize a qualtrics survey. It is shown in iFrame.');
/*!40000 ALTER TABLE `styles` ENABLE KEYS */;
UNLOCK TABLES;

