INSERT INTO `styles_fields` VALUES (0000000001,0000000001,NULL,'The placeholder in the email input field.'),(0000000001,0000000002,NULL,'The placeholder in the password input field.'),(0000000001,0000000003,NULL,'The text on the login button.'),(0000000001,0000000004,NULL,'The name of the password reset link.'),(0000000001,0000000005,NULL,'This text is displayed in a danger-alert-box whenever the login fails.'),(0000000001,0000000007,NULL,'The text displayed in the login card header.'),(0000000001,0000000028,'dark','This allows to choose the colour scheme for the login form.'),(0000000002,0000000005,NULL,'This text will be displayed if a user was unable to change his settings.'),(0000000002,0000000006,NULL,'This field holds the main structure of the profile page content. Styles were used to construct this in order to keep the layout consistent. In order to change specific aspects of the profile page, navigate through the children and make changes where needed.'),(0000000002,0000000019,NULL,'This text will be displayed if a user wants to delete his or her account but the operation failed.'),(0000000002,0000000020,NULL,'This text will be displayed upon successful deletion of a user account.'),(0000000002,0000000035,NULL,'This text will be displayed upon successful change of user settings.'),(0000000003,0000000006,NULL,'The child sections to be added to the `container` body. This can hold any style.'),(0000000003,0000000029,'0','Select for a full width container, spanning the entire width of the viewport.'),(0000000004,0000000006,NULL,'The child sections to be added to the `jumbotron` body. This can hold any style.'),(0000000005,0000000021,'1','The HTML heading level (1-6)'),(0000000005,0000000022,NULL,'The text to be rendered as heading.'),(0000000006,0000000025,NULL,'Use <a href=\"https://en.wikipedia.org/wiki/Markdown\" target=\"_blank\">markdown</a> syntax here.'),(0000000007,0000000026,NULL,'Only use <a href=\"https://en.wikipedia.org/wiki/Markdown\" target=\"_blank\">markdown</a> elements that can be displayed inline (e.g. bold, italic, etc).'),(0000000008,0000000008,NULL,'The text to appear on the button.'),(0000000008,0000000027,NULL,'Use a full URL or any special characters as defined <a href=\"https://selfhelp.psy.unibe.ch/demo/style/440\" target=\"_blank\">here</a>.'),(0000000008,0000000028,'primary','The <a href=\"https://getbootstrap.com/docs/4.1/components/buttons/#examples\" target=\"_blank\">bootstrap type</a> of the button.'),(0000000009,0000000002,NULL,'The label above the password input fields.'),(0000000009,0000000003,NULL,'The text on the back to login link on the success page.'),(0000000009,0000000005,NULL,'This text is displayed in an danger-alert-box if the validation fails.'),(0000000009,0000000006,NULL,'This field is intended for custom input fields that allow the collect further information about a user (also see field `name`)'),(0000000009,0000000009,NULL,'The placeholder for the password confirmation input field.'),(0000000009,0000000022,NULL,'The title of the validation page.'),(0000000009,0000000034,NULL,'The text in the card header of the validation form.'),(0000000009,0000000035,NULL,'On successful validation a new page appears where the content of this field is displayed in a `jumbotron`.'),(0000000009,0000000036,NULL,'The label above the username input field.'),(0000000009,0000000037,NULL,'The placeholder for the username input field.'),(0000000009,0000000038,NULL,'The small description text below the username input field.'),(0000000009,0000000039,NULL,'The label above the gender selection radio buttons.'),(0000000009,0000000040,NULL,'The label next to the male radio button option.'),(0000000009,0000000041,NULL,'The label next to the female radio button option.'),(0000000009,0000000042,NULL,'The text on the submit button to activate the user account.'),(0000000009,0000000043,NULL,'The placeholder for the password input field.'),(0000000009,0000000044,NULL,'On successful validation a new page appears where the content of this field is displayed in as a heading in a `jumbotron`.'),(0000000009,0000000057,NULL,'The validate style allows to add custom input fields in order to collect further data about the user. This data is stored in the database like any other user input. The content of the field `name` will be used in the column `form_name` of the user data export (in the menu *Admin/Export*) for all custom validation input fields.'),(0000000010,0000000005,NULL,'The here defined text will be displayed in an danger-alert-box if it was not possible to send the message. If this alert is shown there is probably an issue with the server.'),(0000000010,0000000030,NULL,'This message is displayed to a user in the role `Therapist` if no `Subject` is selected.'),(0000000010,0000000031,NULL,'This is the first part of the text that is displayed in the message card header. The second part of this text depends on the role of the user.'),(0000000010,0000000032,NULL,'This is the second part of the message card header if the role of the user is `Therapist`.'),(0000000010,0000000033,NULL,'This is the second part of the message card header if the role of the user is `Subject`.'),(0000000010,0000000090,NULL,'The text on the submit button.'),(0000000010,0000000095,'Lobby','The name of the root chat room (the room every user is part of).'),(0000000010,0000000096,'New Messages','This text is used as a divider between messages that are already read and new messages.'),(0000000010,0000000110,NULL,'The notification email to be sent to receiver of the chat message. Use markdown syntax in conjunction with the field `is_html` if you want to send an email with html content. In addition to markdown, the following keyword is supported:\n- `@link` will be replaced by the link to the chat page.'),(0000000010,0000000111,NULL,'The subject of the notification email to be sent to the receiver of the chat message. Use the following keywords to create dynamic content:\n- `@project` will be replaced by the project name.'),(0000000010,0000000114,'0','If *checked*, the email will be parsed as markdown and sent as html. The unparsed email content will be sent as plaintext alternative. If left *unchecked* the emails will only be sent as plaintext'),(0000000011,0000000006,NULL,'The child elements to be added to the alert wrapper.'),(0000000011,0000000028,'primary','The bootstrap color styling of the alert wrapper.'),(0000000011,0000000045,'0','If *checked* the alert wrapper can be dismissed by clicking on a close symbol.\r\nIf *unchecked* the close symbol is not rendered.'),(0000000012,0000000006,NULL,'The child elements to be added to the card body.'),(0000000012,0000000022,NULL,'The content of the card header. If not set, the card will be rendered without a header section.'),(0000000012,0000000028,'light','A bootstrap-esque color styling of the card border and header.'),(0000000012,0000000046,'1','If the field `is_collapsible` is *checked* and the field `is_expanded` is *unchecked* the card is collapsed by default and only by clicking on the header will the body be shown. This field has no effect if `is_collapsible` is left *unchecked*.'),(0000000012,0000000047,'0','If *checked* the card body can be collapsed into the header by clicking on the header.\nIf left *unchecked* no such interaction is possible.'),(0000000012,0000000048,NULL,'The target url of the edit button. If set, an edit button will appear on right of the card header and link to the specified url. If not set no button will be shown.'),(0000000013,0000000006,NULL,'The child sections to be added to the `figure` body. Add only sections of style `image` or `audio` here.'),(0000000013,0000000049,NULL,'The title to be prepended to the text defined in filed `caption`.'),(0000000013,0000000050,NULL,'The caption of the figure.'),(0000000014,0000000006,NULL,'The child sections to be added to the `form` body. This can hold any style.'),(0000000014,0000000008,NULL,'The label on the submit button.'),(0000000014,0000000027,NULL,'The submit URL.'),(0000000014,0000000028,NULL,'The visual appearance of the submit button as predefined by [Bootstrap](!https://getbootstrap.com/docs/4.0/utilities/colors/).'),(0000000014,0000000051,NULL,'If set, a cancel button will be rendered. The here defined text will be used as label for this button.'),(0000000014,0000000052,NULL,'The target URL of the cancel button.'),(0000000015,0000000022,NULL,'The text to be shown when hovering over the image.'),(0000000015,0000000029,'1','If enabled the image scales responsively.'),(0000000015,0000000030,NULL,'The alternative text to be shown if the image cannot be loaded.'),(0000000015,0000000053,NULL,'The image source. If the image is an asset simply use the full name of the asset here.'),(0000000016,0000000008,NULL,'If this field is set, a this text will be rendered above the input field.'),(0000000016,0000000054,'text','A selection of HTML input types. Note that support for these types depends on the browser. Uf a type is not supported by a browser, usually the type `text` is used.'),(0000000016,0000000055,NULL,'If this field is set, the text will be rendered as background inside the input field and will disappear when a value is enterd.'),(0000000016,0000000056,'0','If enabled the form can only be submitted if a value is enterd in this input field.'),(0000000016,0000000057,NULL,'The name of the input form field. This name must be unique within a form.'),(0000000016,0000000058,NULL,'The default value of the input field.'),(0000000017,0000000024,NULL,'The text to be rendered.'),(0000000017,0000000059,'0','If enabled the text will be rendered within HTML `<p></p>` tags. If disabled the text will be rendered without any wrapping tags.'),(0000000018,0000000008,NULL,'Specifies the clickable text. If left empty the URL as specified in the field `url` will be used.'),(0000000018,0000000027,NULL,'Use a full URL or any special characters as defined <a href=\"https://selfhelp.psy.unibe.ch/demo/style/440\" target=\"_blank\">here</a>.'),(0000000018,0000000086,NULL,'If checked the link will be opened in a new tab. If unchecked the link will open in the current tab.'),(0000000019,0000000028,'primary','The visual appearance of the progrres bar as predefined by [Bootstrap](!https://getbootstrap.com/docs/4.0/utilities/colors/).'),(0000000019,0000000060,'0','The current value of the progress bar.'),(0000000019,0000000061,'1','The maximal value of the prpgress bar. The minimal value is 0.'),(0000000019,0000000101,'1','If enabled diagonal stripes are visualized on the progress bar.'),(0000000019,0000000102,'1','If enabled a label of the form `<count>/<count_max>` is displayed on the proggress bar where `<count>` is the value defined in field `count` and `<count_max>` the value defined in field `count_max`.'),(0000000020,0000000028,'light','The visual appearance of the buttons as predefined by [Bootstrap](!https://getbootstrap.com/docs/4.0/utilities/colors/).'),(0000000020,0000000050,NULL,'A question with a binary answer (e.g. Right, Wrong).'),(0000000020,0000000062,NULL,'The label on the first answer button (e.g. right). Clicking this button will reveal the content as defined in the field `right_content`.'),(0000000020,0000000063,NULL,'The label on the second answer button (e.g. wrong). Clicking this button will reveal the content as defined in the field `wrong_content`.'),(0000000020,0000000064,NULL,'The body to the first answer button as defined in field `label_right`. The content of this field usually states whether this answer was correct or false and provides an explanation as to why.'),(0000000020,0000000065,NULL,'The body to the second answer button as defined in field `label_wrong`. The content of this field usually states whether this answer was correct or false and provides an explanation as to why.'),(0000000021,0000000024,NULL,'The text to be rendered with mono-space font.'),(0000000022,0000000008,NULL,'If this field is set, a this text will be rendered above the selec