submission fails, an error message will indicate the reason.'),(0000000036,0000000057,NULL,'A unique name to identify the form when exporting the collected data.'),(0000000036,0000000087,'0','This fiels allows to control how the data is saved in the database:\n - `disabled`: The submission of data will always overwrite prior submissions of the same user. This means that the user will be able to continously update the data that was submitted here. Any input field that is used within this form will always show the current value stored in the database (if nothing has been submitted as of yet, the input field will be empty or set to a default).\n - `enabled`: Each submission will create a new entry in the database. Once entered, an entry cannot be removed or modified. Any input field within this form will always be empty or set to a default value (nothing will be read from the database).'),(0000000036,0000000139,NULL,'Search for the name of the anchor section to jump to after submitting the form. The ID of the section will be used as anchor. If this field is not set the section ID of the form itself will be used as anchor. This is useful if the form is placed within a collapsable card and the form anchor is hidden. In this case it makes sense to use the parent card as anchor here.'),(0000000038,0000000008,NULL,'If this field is set, a this text will be rendered above the radio elements.'),(0000000038,0000000056,'0','If enabled the form can only be submitted if a value is selected.'),(0000000038,0000000057,NULL,'The name of the radio form field. This name must be unique within a form.'),(0000000038,0000000058,NULL,'The preselected item of the radio elements.'),(0000000038,0000000066,NULL,'This field expects a [JSON](!https://www.json.org/json-en.html) list of radio objects where each object has the following keys:\n- `value`: the value to be submitted if this item is selected\n-`text`: the text rendered next to the radio button.\n\nAn Example\n```\n[{\n  \"value\":\"1\",