'If *checked*, the email will be parsed as markdown and sent as html. The unparsed email content will be sent as plaintext alternative. If left *unchecked* the emails will only be sent as plaintext'),(0000000049,0000000008,NULL,'The label to be displayed above the autocomplete input field.'),(0000000049,0000000055,NULL,'The placeholder text to be displayed in the autocomplete input field.'),(0000000049,0000000056,NULL,'True if the field is required, false otherwise.'),(0000000049,0000000057,NULL,'The name of the autocomplete input field.'),(0000000049,0000000058,NULL,'The default value to be set in the hidden autocomplete value input field.'),(0000000049,0000000097,NULL,'If set to true, debug information is shown in an alert box.'),(0000000049,0000000118,NULL,'The name of the hidden autocomplete value input field.'),(0000000049,0000000119,NULL,'The name of the class to be instantiated in the AJAX request.'),(0000000049,0000000120,NULL,'The name of the method to be called on the class instance as defined in `callback_class`.'),(0000000050,0000000022,NULL,'The title to be rendered on top of teh graph. This field is here purely for convenience as the title of a graph can also be defined in the field `layout`'),(0000000050,0000000122,NULL,'Define the data traces to be rendered. Refer to the documentation of [Plotly.js](https://plotly.com/javascript/) for more information'),(0000000050,0000000123,NULL,'Define the layout of the graph. Refer to the documentation of [Plotly.js](https://plotly.com/javascript/) for more information'),(0000000050,0000000124,NULL,'Define the configuration of the graph. Refer to the documentation of [Plotly.js](https://plotly.com/javascript/) for more information'),(0000000051,0000000022,NULL,'The title of the Sankey diagram.'),(0000000051,0000000069,'1','The minimal required item count to form a link. In other words: what is the minimal required link width for a link to be displayed'),(0000000051,0000000121,NULL,'The source of the data to be used to draw the Sankey diagram.'),(0000000051,0000000125,NULL,'In order to create a Sankey diagram from a set of user input data two types of information are required:\r\n 1. the form field names defined here (think of it as the column headers of a table where each row holds the data of one subject)\r\n 2. the value types defined in `value_types` (the value entered by the subject).\r\n\r\nThe Sankey diagram consist of *nodes* and *links*. All possible combinations of form field names (1) and value types (2) define the nodes in a Sankey diagram. The links are computed by accumulating all values of the same type (2) when transitioning from one field name (1) to another.\r\n\r\nThis field expects an ordered list (`json` syntax) which specifies the form field names (1) to be used to generate the Sankey diagram. The order is important because two consecutive form field names (1) form a transition. Each list item is an object with the following fields:\r\n - `key`: the name of the field. When using static data this refers to a column name from the table specified in the field `data-source`. When using dynamic data this refers to a user input field name of the form specified in the field `data-source`.\r\n - `label`: A human-readable label which can be displayed on the diagram.\r\n\r\nAn Example\r\n```\r\n[\r\n  { \"key\": \"field1\", \"label\": \"Field 1\" },\r\n  { \"key\": \"field2\", \"label\": \"Field 2\" }\r\n]\r\n```'),(0000000051,0000000126,NULL,'In order to create a Sankey diagram from a set of user input data two types of information are required:\n 1. the form field names defined in `form_field_names` (think of it as the column headers of a table where each row holds the data of one subject)\n 2. the value types defined here (the value entered by the subject).\n\nThe Sankey diagram consist of *nodes* and *links*. All possible combinations of form field names (1) and value types (2) define the nodes in a Sankey diagram. The links are computed by accumulating all values of the same type (2) when transitioning from one field name (1) to another.\n\nThis field expects an ordered list (`json` syntax) which specifies the value types (2) to be used to generate the Sankey diagram. The order is important because it may be used for node placement. Each list item is an object with the following fields:\n - `key`: the value of the value type.\n - `label`: A human-readable label which can be displayed on the diagram.\n - `color`: A hex string definig the color of the node of this type. Use a string of the following from `\"#FF0000\"`\n\nAn Example\n```\n[\n  { \"key\": 1, \"label\": \"Value Type 1\", \"color\": \"#FF0000\" },\n  { \"key\": 2, \"label\": \"Value Type 2\", \"color\": \"#00FF00\" }\n]\n```'),(0000000051,0000000127,NULL,'Define the color of the links. There are four options:\n - `source`: use the color of the source node\n - `target`: use the color of the target node\n - a hex string of the from `#FF0000` to define the same color for all links\n - the empty string to use the default translucent gray'),(0000000051,0000000128,NULL,'Define the alpha value of the color of the links. There are two options:\n - `sum`: compute the alpha value based on the width of the link\n - any number from 0 to 1: the same alpha value for all links as defined'),(0000000051,0000000129,'0','If checked, the labels defined in `value_types` are displayed next to a node with the corresponding type'),(0000000051,0000000130,'1','If checked, the label defined in `form_field_names` is displayed on top of a grouped node column. This field only has an effect if `is_grouped` is enabled.'),(0000000051,0000000131,'1','If checked, the nodes are positioned as follows:\n - each node with the same form field name is aligned vertically (same x coordinate)\n - within one column nodes are sorted by value types (by their indices as defined in `value_types`'),(0000000051,0000000132,'1','This option only takes effect when using **dynamic** data. If checked, only data from the current logged-in user is used. If unchecked, data form all users is used.'),(0000000052,0000000008,NULL,'The name to be rendered on the filter button.'),(0000000052,0000000028,NULL,'The visual apperance of the button as predefined by bootstrap.'),(0000000052,0000000057,NULL,'The name of the table column or form field to filter on.'),(0000000052,0000000058,NULL,'The value of the filter. All data sets of the data source (as specified by `data-source`) where the field (as specified by `name`) holds a value equal to the one indicated here will be selected.'),(0000000052,0000000121,NULL,'The source of the data to be filtered.'),(0000000053,0000000028,NULL,'The visual apperance of the buttons as predefined by bootstrap.'),(0000000053,0000000029,'0','If checked, the button group is streched to fill 100% of the available width. If unchecked, the button group is stretched to fit all text within each button but never more than available space.'),(0000000053,0000000057,NULL,'The name of the table column or form field to filter on.'),(0000000053,0000000068,NULL,'The names to be rendered on the filter buttons. Use a JSON array to specify all labels. The labels must correspond to the values as specified in `values`'),(0000000053,0000000121,NULL,'The source of the data to be filtered.'),(0000000053,0000000134,NULL,'The value of each filter button. All data sets of the data source (as specified by `data-source`) where the field (as specified by `name`) holds a value equal to the one indicated here will be selected. Use a JSON array to specify all values. The values must correspond to the labels as specified in `labels`.'),(0000000053,0000000135,'0','If checked, the button group is rendered as a vertical stack. If unchecked, the button group is rendered as a vertical list.'),(0000000054,0000000057,NULL,'The name of the table column or form field to use to render a pie diagram.'),(0000000054,0000000121,NULL,'The source of the data to be used to render a pie diagram.'),(0000000054,0000000123,NULL,'Define the layout of the graph. Refer to the documentation of [Plotly.js](https://plotly.com/javascript/) for more information'),(0000000054,0000000124,NULL,'Define the configuration of the graph. Refer to the documentation of [Plotly.js](https://plotly.com/javascript/) for more information'),(0000000054,0000000126,NULL,'Defines the label and color for each distinct data value. Use a JSON array where each item has the following keys:\n - `key`: the data value to which the color and label will be assigned\n - `label`: to the label of the data value\n - `color`: the color of the data value (optional)\n\nAn example:\n```\n[\n  { \"key\": \"value_1\", \"label\", \"Label 1\", \"color\": \"#ff0000\" },\n  { \"key\": \"value_2\", \"label\", \"Label 2\", \"color\": \"#00ff00\" }\n}\n```'),(0000000054,0000000132,'1','This option only takes effect when using **dynamic** data. If checked, only data from the current logged-in user is used. If unchecked, data form all users is used.'),(0000000054,0000000136,'0','Use this to render a donut chart. Use a percentage from 0 to 100 where 0% means no hole and 100% a hole as big as the chart.'),(0000000054,0000000137,NULL,'Allows to define the information to be rendered in the hover box. Use \"none\" to disable the hover box. Refer to the [Plotly.js documentation](!https://plotly.com/javascript/reference/#pie-hoverinfo) for more information.'),(0000000054,0000000138,NULL,'Allows to define the information to be rendered on each pie slice. Use \"none\" to show no text. Refer to the [Plotly.js documentation](!https://plotly.com/javascript/reference/#pie-textinfo) for more information.'),(0000000055,0000000057,NULL,'The name of the table column or form field to use to render a pie diagram.'),(0000000055,0000000121,NULL,'The source of the data to be used to render a pie diagram.'),(0000000055,0000000123,NULL,'Define the layout of the graph. Refer to the documentation of [Plotly.js](https://plotly.com/javascript/) for more information'),(0000000055,0000000124,NULL,'Define the configuration of the graph. Refer to the documentation of [Plotly.js](https://plotly.com/javascript/) for more information'),(0000000055,0000000126,NULL,'Defines the label and color for each distinct data value. Use a JSON array where each item has the following keys:\n - `key`: the data value to which the color and label will be assigned\n - `label`: to the label of the data value\n - `color`: the color of the data value (optional)\n\nAn example:\n```\n[\n  { \"key\": \"value_1\", \"label\", \"Label 1\", \"color\": \"#ff0000\" },\n  { \"key\": \"value_2\", \"label\", \"Label 2\", \"color\": \"#00ff00\" }\n}\n```'),(0000000055,0000000132,'1','This option only takes effect when using **dynamic** data. If checked, only data from the current logged-in user is used. If unchecked, data form all users is used.'),(0000000056,0000000126,NULL,'Defines the label and color for each distinct data value. Use a JSON array where each item has the following keys:\n - `key`: the data value to which the color and label will be assigned\n - `label`: to the label of the data value\n - `color`: the color of the data value\n\nAn example:\n```\n[\n  { \"key\": \"value_1\", \"label\", \"Label 1\", \"color\": \"#ff0000\" },\n  { \"key\": \"value_2\", \"label\", \"Label 2\", \"color\": \"#00ff00\" }\n}\n```'),(0000000057,0000000066,NULL,'JSON structure for the navigation bar'),(0000000058,0000000144,'','Select a survey. TIP: A Survey should be assigned to a project (added as a action)');
